import React from 'react'
import st from './Dialogs.module.css'
import {NavLink} from "react-router-dom"
import DialogItem from "./DialogItem/DialogItem";
import Message from "./Message/Message";

const Dialogs = (props) => {
    let myUsers = [
        {id: '1', name: 'Elena'},
        {id: '2', name: 'Alice'},
        {id: '3', name: 'Sergei'},
        {id: '4', name: 'Irina'},
        {id: '5', name: 'Tamara'}
    ]
    let allMessages = [
        {
            id: '1',
            from: 'Elena',
            to: 'Alice',
            message: 'Hello. how are you?',
            date: '25.06.20'
        },
        {
            id: '2',
            from: 'Alice',
            to: 'Elena',
            message: 'Hello. I am fine. What about you?',
            date: '25.06.20'
        },
        {
            id: '3',
            from: 'Elena',
            to: 'Tamara',
            message: 'Hello. how are you?',
            date: '26.06.20'
        }
    ]

    return (
        <div className={st.dialogs}>
            <div className={st.dialogs_items}>
                {myUsers.map((element) => {
                    return (
                        <div key={element.id}>
                        <DialogItem name={element.name} id={element.id}/>
                        </div>
                    )
                })}

            </div>
            <div className={st.messages}>
                {allMessages.map((element)=> {
                    return (
                        <div key={element.id}>
                        <Message item={element.date +' From ' + element.from + ' to ' + element.to +' : ' + element.message}/>
                    </div>
                        )
                })}

            </div>
        </div>
    )
}
export default Dialogs
